INSERT INTO `winter_blog_posts` (`id`, `user_id`, `title`, `slug`, `excerpt`, `content`, `content_html`, `published_at`, `published`, `created_at`, `updated_at`, `metadata`, `programs`, `package_list`, `tes`, `blog`) VALUES
(2, 1, 'Holistic Health Counseling', 'holistic-health-counseling', '', NULL, '', '2022-11-17 16:00:00', 1, '2022-11-17 22:46:58', '2022-11-17 23:02:49', NULL, '{\"position\":\"top\",\"description\":\"<p>This consultation is based on Usada Bali and Ayurveda. Get knowledge about the body type, diet, and the right habits for each individual to maintain health in the Prakruti Assessment. Get knowledge about the nature of birth, career, mate, disease and how to overcome it through reading Wariga (Balinese Astrology) and Palm Reading by our healer.<\\/p>\\r\\n\"}', NULL, NULL, ''),
(3, 1, 'Therapeutic Yoga & Meditation', 'therapeutic-yoga-meditation', '', NULL, '', '2022-11-16 16:00:00', 1, '2022-11-17 22:50:45', '2022-11-17 23:02:25', NULL, '{\"position\":\"top\",\"description\":\"<p>Yoga not only disciplines the body but also unlocks the limitless potential of the human mind and spirit. From beginner introductions to more intensive yoga retreats, you can immerse yourself in this ancient tradition for total serenity. This exercise manages our emotions, to create beautiful feelings and balance energy. On an emotional level, the flow of life force energy\\/prana helps us to think clearly, see things in the right perspective.<\\/p>\\r\\n\"}', NULL, NULL, ''),
(4, 1, 'Purificatory Rite (Melukat)', 'purificatory-rite-melukat', '', NULL, '', '2022-11-15 16:00:00', 1, '2022-11-17 22:56:23', '2022-11-17 23:02:02', NULL, '{\"position\":\"top\",\"description\":\"<p>Self-healing is done not only by physical but also spiritual treatment. In Bali spiritual treatment is carried out with ceremonial ceremonies. The ceremony for humans is called Melukat. Experience the ritual to purify the aura and karma from your past through the melukat program<\\/p>\\r\\n\"}', NULL, NULL, ''),
(5, 1, 'Palm Reading', 'palm-reading', '', NULL, '', '2022-11-17 16:00:00', 1, '2022-11-17 23:05:26', '2022-11-17 23:05:26', NULL, '{\"position\":\"bottom\",\"description\":\"<p>Get knowledge about the nature of birth, career, mate, disease and how to overcome it through Palm Reading by our healer.<\\/p>\\r\\n\"}', NULL, NULL, ''),
(6, 1, 'Cooking Class', 'cooking-class', '', NULL, '', '2022-11-16 16:00:00', 1, '2022-11-17 23:06:45', '2022-11-17 23:06:45', NULL, '{\"position\":\"bottom\",\"description\":\"<p>In addition to providing health effects, there are many stories of the use of various spices in processed Balinese cuisine. The same goes for the story of how and who makes and processes it \\u2013 in Balinese tradition it is called Belawa. You can pick a variety of spice ingredients directly from the garden around the kitchen. Work it out to give a balance effect to your body and soul. Let\'s go around the garden, harvest, cook and eat together, and listen to Belawa stories in this herbal class.<\\/p>\\r\\n\"}', NULL, NULL, ''),
(7, 1, 'Herbal Class', 'herbal-class', '', NULL, '', '2022-11-15 16:00:00', 1, '2022-11-17 23:07:48', '2022-11-17 23:07:48', NULL, '{\"position\":\"bottom\",\"description\":\"<p>Balinese healing arts are passed down from generation to generation. From Grandma to Mother, from Mother to Son. Home remedies that are usually made by Balinese people with ingredients that grow around them, such as boreh (herbal scrub), massage oil (massage oil), and loloh (herbal tonic) are still done at our place. Get the experience of discovering and concocting Balinese home remedies that are believed to be effective in relaxing and helping a tired body return after working in this herbal class.<\\/p>\\r\\n\"}', NULL, NULL, ''),
(8, 1, 'Koko Santi', 'koko-santi', '', NULL, '', '2022-11-16 16:00:00', 1, '2022-11-18 03:15:28', '2022-11-18 03:15:28', NULL, '{\"position\":\" \",\"description\":\"\\r\\n\"}', NULL, '{\"message\":\"A very beautiful place the owner and staff are very friendly with an amazing medicinal plant garden that can be very good for learning and reconnecting with the motherland.\"}', ''),
(9, 1, 'Koko Santi 2', 'koko-santi-2', '', NULL, '', '2022-11-14 16:00:00', 1, '2022-11-18 03:16:19', '2022-11-18 03:16:19', NULL, '{\"position\":\" \",\"description\":\"\\r\\n\"}', NULL, '{\"message\":\"A very beautiful place the owner and staff are very friendly with an amazing medicinal plant garden that can be very good for learning and reconnecting with the motherland.\"}', ''),
(10, 1, 'Environment', 'environment', '', NULL, '', '2022-11-16 16:00:00', 1, '2022-11-18 03:44:58', '2022-11-18 03:44:58', NULL, '{\"position\":\" \",\"description\":\"\\r\\n\"}', NULL, '{\"link_url\":\"\",\"message\":\"\"}', ''),
